def minNumCoins(v, c):
    """"""
    minCoins = [float('inf')] * (v + 1)
    minCoins[0] = 0
    for j in range(len(c)):
        for i in range(c[j], v + 1):
            minCoins[i] = min(minCoins[i], minCoins[i - c[j]] + 1)
    return minCoins[v] if minCoins[v] != float('inf') else -1
